INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 0, 2, "お！\nあそこに困ってそうな人発見！", 0, 1, 0, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 1001);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 0, 2, "大切な人を\n守れるようになりたい…って", 0, 1, 0, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 1002);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "フェンシングを始めてみては？", 0, 1, 0, 2, "キミに必要な集中力と感性が", 0, 1, 0, "士条 怜", "少しは磨かれると思いますよ。", 1.4, 1003);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ねぇ、にいちゃん！", 0, 1, 0, 2, "今日はなにして遊ぶ？", 0, 1, 0, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 1004);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "風宮あかりです", 0, 1, 0, 2, "ねぇ…", 0, 1, 0, "風宮 あかり", "私といっしょに…\nいかない？", 1.4, 1006);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "出雲宮子なのー", 0, 1, 0, 2, "プリンたべたいのー", 0, 1, 0, "出雲 宮子", "食べ物の恨みは怖いのー", 1.5, 1007);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ボクは虹村雪。", 0, 1, 0, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 0, "虹村 雪", "いいよ。\n見られることは運命さ…", 1.4, 1008);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "フッ…聞いて後悔するがいい！", 0, 1, 0, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 0, "柊杏奈", "人呼んで「疾風の冥姫」!!", 1.4, 1009);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 0, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 0, "姫宮 真歩", "ほんまおおきにやわ～♪", 1.5, 1010);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "衣之咲璃乃です！", 0, 1, 0, 2, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 0, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 1.4, 1011);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 0, 2, "ち、超能力って…\n何のことかな～？", 0, 1, 0, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 1012);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 0, 2, "一応カリスマ読モJKやってまっす！", 0, 1, 0, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 1016);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "はいたーい。\n喜屋武香織さー。", 0, 1, 0, 2, "東京は遊園地みたいなところさー", 0, 1, 0, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 1.4, 1017);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "支倉伊緒です。", 0, 1, 0, 2, "先生って呼ばれるのは\nくすぐったいから", 0, 1, 0, "支倉 伊緒", "イオちゃんって呼んでね。", 1.4, 1018);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 0, 2, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 0, "茜 ミミ", "ミミをおいてかないでぇ～", 1.5, 1020);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 0, 2, "あの……\nふぇ……", 0, 1, 0, "栗林 くるみ", "ふぇぇぇぇぇん……", 1.5, 1021);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "風宮よりです。\nあああああ！", 0, 1, 0, 2, "こんな私に貴重な時間を\n割いていただき、", 0, 1, 0, "風宮 より", "なんてありがとうございます！", 1.4, 1022);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 0, 2, "おにいちゃんどこいくの？\nえ？", 0, 1, 0, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 1.5, 1023);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 0, 2, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 0, "天野 すずめ", "これて何か違う…\nあああすみません！", 1.4, 1025);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "……クスクス…私は\n…倉石恵理子……", 0, 1, 0, 2, "あなたは…運命の……\n伴侶……", 0, 1, 0, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 1.4, 1027);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 0, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 0, "佐々木 咲恋", "…そうでしょ？？", 1.4, 1028);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "桜井望だよ！\nよろしくねっ", 0, 1, 0, 2, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 0, "桜井 望", "あはは、\n私もまだまだだなぁ～", 1.4, 1029);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "デケデケデンっ！", 0, 1, 0, 2, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 0, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 1030);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 0, 2, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 0, "上喜 しのぶ", "おかしいですね……", 1.4, 1031);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 0, 2, "けんども\nそれには足りないモンが…", 0, 1, 0, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 1.5, 1033);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 0, 2, "ちょっと緊張しちゃって…", 0, 1, 0, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 1.4, 1034);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "氷川鏡華…です", 0, 1, 0, 2, "知らない人とは話しちゃいけないので", 0, 1, 0, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 1.5, 1036);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "柏崎…栞です。", 0, 1, 0, 2, "……あ、アラーム。", 0, 1, 0, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4, 1038);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "ふ、双葉碧です。", 0, 1, 0, 2, "私、一人も友達がいなくて……", 0, 1, 0, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 1.4, 1040);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "三角千歌です。", 0, 1, 0, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 0, "三角 千歌", "そう思っています。", 1.4, 1042);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "安芸真琴だ。", 0, 1, 0, 2, "あぁ？\nお前のそいつの仲間か？", 0, 1, 0, "安芸 真琴", "う、疑ってすまなかったな…", 1.4, 1043);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "わらわこそは夜を総べる者！", 0, 1, 0, 2, "生けとし生ける全ての者よ！", 0, 1, 0, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4, 1044);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "そこで騎士は妖精を乱暴に……", 0, 1, 0, 2, "ぐふふふふ……はっ！", 0, 1, 0, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 1.4, 1045);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 0, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 0, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 1.4, 1046);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "大神美冬よ！", 0, 1, 0, 2, "それでは早速クエストに…", 0, 1, 0, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4, 1048);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "星野静流だよ！", 0, 1, 0, 2, "クエストもバトルも\n掃除も洗濯も", 0, 1, 0, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4, 1049);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "アタシは玉泉美咲。", 0, 1, 0, 2, "見ての通りの\nセクシー美少女で", 0, 1, 0, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5, 1050);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "？？？", 0, 1, 0, 2, "？？？？", 0, 1, 0, "リマ", "？？？？", 1.4, 1052);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 1.5, 1053);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 1.5, 1058);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, "コッコロ", "そ、そこまでいうなら\nもらってやる", 1.5, 1059);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, "キャル", "そ、そこまでいうなら\nもらってやる", 1.5, 1060);
